    const closeAddNewForm = ()=>{
        setAddNew(false)
    }




    return (
       <div>
           {addNew ?  
           < AddNewArtist closeAddNewFormCB={closeAddNewForm}/> :  

           <button onClick={()=>setAddNew(true)}>Create New Artist</button>  }



       </div>
        )
}

